import React from "react";
import Navbar from "../components/Navbar/Navbar";
import Container from "../tic-tac-toe/Container/Container";

function TicTacToe() {
  return (
    <>
      <Navbar logo="TIC-TAC-TOE"  />
      <Container />
    </>
  );
}

export default TicTacToe;
